                    {
                        html.Append(hymnContent.Content_Coptic);
                        html.Append("<br /><br />");
                        html.Append("<br /><br />");
                    }

                    if (!string.IsNullOrWhiteSpace(hymnContent.Content_English))
                    {
                        html.Append(hymnContent.Content_English);
                        html.Append("<br /><br />");
                        html.Append("<br /><br />");
                    }

                    if (!string.IsNullOrWhiteSpace(hymnContent.Content_Arabic))
                    {
                        html.Append(@"<div style=""text-align: right; direction: rtl; padding-right: 15px"">");
                        html.Append(hymnContent.Content_Arabic);
                        html.Append(@"</div>");
                    }

                    // hymn content separator
                    html.Append("<br /><br />");
                    html.Append("<br /><br />");
                    html.Append("<hr /><br />");
                }

                source.Html = html.ToString();
                orderedPages[2] = new ContentPage
                {
                    Icon = Device.RuntimePlatform == Device.iOS ? "document.png" : null,
                    Title = "Vertical Hazzat",
                    Content = new WebView { Source = source }
                };

                UpdateTabs();
            }

            IsBusy = false;
        }

        private void UpdateTabs()
        {
            int tabIndex = 0;

            foreach (var pagePair in orderedPages.OrderBy(kvp => kvp.Key))
            {
                // found a page to add or replace
                if (pagePair.Value != null)
                {
                    if (ContentTabs.Count == tabIndex)
                    {
                        ContentTabs.Add(pagePair.Value);
                    }
                    else
                    {
                        ContentTabs[tabIndex].Icon = pagePair.Value.Icon;
                        ContentTabs[tabIndex].Title = pagePair.Value.Title;
                        ContentTabs[tabIndex].Content = pagePair.Value.Content;
                    }

                    tabIndex++;
                }                
            }
        }
    }
